CREATE   TABLE  interno.unmasked_patrimonio_fundos  (
id_tab                int  GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
fundo                 varchar(100),
data                  date, 
patrimonio_liquido    double precision,
data_extracao         date   default  current_date)







CREATE MATERIALIZED VIEW IF NOT EXISTS interno.unmasked_patrimonio_fundos
TABLESPACE pg_default
AS
 SELECT fundo,
    data,
    patrimonio_liquido,
    data_extracao
   FROM interno.unmasked_patrimonio_fundos_fkt
WITH DATA;

ALTER TABLE IF EXISTS interno.unmasked_patrimonio_fundos
    OWNER TO netz_admin;

GRANT INSERT, SELECT, UPDATE, DELETE ON TABLE interno.unmasked_patrimonio_fundos TO admin_full_access;
GRANT SELECT ON TABLE interno.unmasked_patrimonio_fundos TO frontend;
GRANT ALL ON TABLE interno.unmasked_patrimonio_fundos TO netz_admin;







